package test.jmul.math.numbers;


import java.util.ArrayList;
import java.util.Collection;

import jmul.math.Math;
import jmul.math.numbers.Number;
import static jmul.math.numbers.NumberHelper.createNumber;

import jmul.test.classification.UnitTest;

import static org.junit.Assert.assertEquals;
import org.junit.Ignore;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.junit.runners.Parameterized;


/**
 * This test suite tests multiplying two numbers with various combinations of operands.
 *
 * @author Kristian Kutin
 */
@Ignore
@UnitTest
@RunWith(Parameterized.class)
public class MultiplyLargeNumbersTest {

    /**
     * A number.
     */
    private final Number number1;

    /**
     * A number.
     */
    private final Number number2;

    /**
     * The expected result.
     */
    private final Number expectedResult;

    /**
     * Creates a new test case according to the specified parameters.
     *
     * @param number1
     *        a number
     * @param number2
     *        a number
     * @param expectedResult
     *        the expected result
     */
    public MultiplyLargeNumbersTest(Number number1, Number number2, Number expectedResult) {

        super();

        this.number1 = number1;
        this.number2 = number2;
        this.expectedResult = expectedResult;
    }

    /**
     * Returns a string retpresentation for this test case.
     *
     * @return a string representation
     */
    @Override
    public String toString() {

        return String.format("[base:%d] %s * [base:%d] %s = [base:%d] %s", number1.base(), number1, number2.base(),
                             number2, expectedResult.base(), expectedResult);
    }

    /**
     * Tests adding the summands and checks the result.
     */
    @Test(timeout = 2000L)
    public void testSubtraction() {

        Number actualResult = number1.multiply(number2);

        assertEquals(toString(), expectedResult, actualResult);
        assertEquals(toString(), expectedResult.toString(), actualResult.toString());
    }

    /**
     * Tests adding the summands and checks the result.
     */
    @Test(timeout = 2000L)
    public void testSubtractionVariant2() {

        Number actualResult = Math.multiply(number1, number2);

        assertEquals(toString(), expectedResult, actualResult);
        assertEquals(toString(), expectedResult.toString(), actualResult.toString());
    }

    /**
     * Returns a matrix of test data and expected results.
     *
     * @return a matrix of test data and expected results
     */
    @Parameterized.Parameters
    public static Collection<Object[]> data() {

        Collection<Object[]> parameters = new ArrayList<Object[]>();

        parameters.add(createTestCase(10, "1234567890", "2345678901", "2895899851425088890"));
        parameters.add(createTestCase(10, "12345678901234567890", "23456789012345678901", "289589985200426886031397677651425088890"));
        parameters.add(createTestCase(10, "123456789012345678901234567890", "234567890123456789012345678901",
                                      "28958998520042688603718947735485444664031397677651425088890"));
        parameters.add(createTestCase(10, "1234567890123456789012345678901234567890",
                                      "2345678901234567890123456789012345678901",
                                      "2895899852004268860371894773554336266106569125515485444664031397677651425088890"));
        parameters.add(createTestCase(10, "12345678901234567890123456789012345678901234567890",
                                      "23456789012345678901234567890123456789012345678901",
                                      "289589985200426886037189477355433626610714830548582838043906569125515485444664031397677651425088890"));
        parameters.add(createTestCase(10, "123456789012345678901234567890123456789012345678901234567890",
                                      "234567890123456789012345678901234567890123456789012345678901",
                                      "28958998520042688603718947735543362661071483054858862984360999848326582838043906569125515485444664031397677651425088890"));
        parameters.add(createTestCase(10,
                                      "123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890",
                                      "234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901",
                                      "28958998520042688603718947735543362661071483054858862984361057766323622923421114007020986572169986174363787369151057612028655651685718776416857198766514251989134278410161713162140999848326582838043906569125515485444664031397677651425088890"));
        parameters.add(createTestCase(10,
                                      "123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890",
                                      "234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901",
                                      ""));
        parameters.add(createTestCase(10,
                                      "",
                                      "",
                                      ""));
        parameters.add(createTestCase(10,
                                      "",
                                      "",
                                      ""));
        parameters.add(createTestCase(10,
                                      "",
                                      "",
                                      ""));
        parameters.add(createTestCase(10,
                                      "",
                                      "",
                                      "0"));
        parameters.add(createTestCase(10,
                                      "",
                                      "",
                                      "0"));
        parameters.add(createTestCase(10,
                                      "",
                                      "",
                                      "0"));
        parameters.add(createTestCase(10,
                                      "",
                                      "",
                                      "0"));
        parameters.add(createTestCase(10,
                                      "",
                                      "",
                                      "0"));

        return parameters;
    }

    /**
     * Creates a test case according to the specified parameters.
     *
     * @param base
     *        a number base
     * @param numberString1
     *        a number string
     * @param numberString2
     *        a number string
     * @param resultString
     *        a number string
     *
     * @return an object array
     */
    private static Object[] createTestCase(int base, String numberString1, String numberString2, String resultString) {

        return new Object[] {
               createNumber(base, numberString1), createNumber(base, numberString2), createNumber(base, resultString) };
    }

}
